import React from 'react';

const categories = [
  { name: 'Perfume', description: 'All types of perfumes' },
  { name: 'Clothing', description: 'Men and women clothing' },
  { name: 'Accessories', description: 'Watches, bags, etc.' },
];

function Categories() {
  return (
    <div className="max-w-2xl mx-auto p-6">
      <h1 className="text-2xl font-bold mb-4">Categories</h1>
      <ul className="space-y-3">
        {categories.map((cat) => (
          <li key={cat.name} className="bg-white rounded shadow p-4 flex flex-col">
            <span className="font-semibold text-lg">{cat.name}</span>
            <span className="text-gray-500 text-sm">{cat.description}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Categories;
